import React, { ReactNode } from "react";
import { ICard, ICardProps } from "../../interFaces/interFaces";
// import "./Card.css";

const  Card: React.FC <ICard> = (props: ICard) => {
//   const restProps: ICard | undefined = props?.rest;
  return (
    <>
      <div className="card">
        <img className="food" src={props.img} alt={props.name} />
        <div className="card-downer-div">
          <h1>{props.name} </h1>
          <p>{props.chef ? props.chef : props.about}</p>
          <section>
            {props.rating ? <img src={props.rating} alt="rating"/> : props.icons?.map((source:string, index:number)=> <img src={source} key={index} alt="icon" />)}
          </section>
          se
        </div>
      </div>
    </>
  );
};

export default  Card;
